instruction:
Removed back cover, noticed the start relay was a Klixon figured it was bad(they don't make a good relay);
Checked voltage going to compressor: 115V;
Checked ohms: C-S-R 4.3-4.2-4.5;
Checked ground: open;

Replaced start relay.
Compressor fired right up when plugged in.

Was incredibly easy.
1. Top front of fridge: remove cover, about 4 Philips Head screws, lift up and slide back, being careful of small wires (door position sensing magnetic switches).
2. We are working on the upper right door hinge: this was way too simple, there is a toggle lever that locks the upper bearing plate in position;
